window.bookSummaryJSON = "<p>February, 2043:</p> <p><b>Jack and the crew of the Crimson Alliance have finally made it back from the Realm of Order, but the threat to Eldgard is deadlier than ever. </b></p> <p>Vogthar incursions are increasing, dungeons falling in droves, towns and cities ravaged by Darklings - Players and NPCs who have willingly sided with the Dark Overmind Thanatos. But thanks to a priceless artifact Jack found after defeating the Lich Priest, there might be a glimmer of hope on the horizon. Jack and company have unearthed a Doom-Forged relic, one part of an ancient weapon capable of killing even a god. But to assemble the legendary god-killer, they’ll need to find the other relics and locate the fabled Doom Forge of the Dwarven godling Khalkeús, all while unraveling a mystery five hundred years in the making.&nbsp;</p> <p>From James A. Hunter the author of the Yancy Lazarus Series, War God's Mantle, and the litRPG epic Rogue Dungeon!</p>"; 
